import React, { Component } from 'react'

export default class Video extends Component {
  render() {
    return (
      <div className="video">
        <div className="leftside"><h1>TAKE PICTURE</h1></div>
        <div className="rightsize"><h1>IMAGE URL</h1></div>
      </div>
    )
  }
}
